function Expenses(props) {

    return(
    <div className="expenses">
    expenses.map((ele, ind) => (
        <ExpenseItem key={ind} date={ele.date} title={ele.title} amount={ele.amount}></ExpenseItem>

        ))

        </div>)

}


export default Expenses
